function randomHex(length) {
    // 确保传入的长度是偶数，因为每个字节对应两个十六进制字符
    if (length % 2 !== 0) {
        throw new Error('Length must be an even number');
    }
    
    const bytes = crypto.randomBytes(length / 2);
    return bytes.toString('hex');
}
function get_data(address,projectId=null,votingPower=null){
    var y=F('97565')
    var t
    t=votingPower||undefined
    var r = {
        address: address,
        projectId:projectId|| y.utils.utf8ToHex(randomHex(32)),
        votingPower: t
    } 

    var l ='A1b2C3d4E5f6G7h8I9j0K!#'
    let data = CryptoJS.AES.encrypt(JSON.stringify(r), l).toString()
    let message=y.utils.sha3(JSON.stringify(r))
    return [data,message,address]
}
